INSERT INTO `wac_drama_script` VALUES (/*command_id*/27212009, /*drama_id*/27212, /*command_type*/11, /*param_01*/103411, /*param_02*/"うっひゃは～い！　麦しゅわパワ～～！\n気持ちよ～く描けたわ～！\nれも、ほんっとにちょ～～～っとだけ、\n飲みすぎちゃったかも……？", /*param_03*/10, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/0.5);
