INSERT INTO `wac_drama_script` VALUES (/*command_id*/33812009, /*drama_id*/33812, /*command_type*/11, /*param_01*/102211, /*param_02*/"……この仕事って、気を付けないと\n服が塗料で汚れちゃうのが困るわね。\n昨日はアカリが思いっきり汚してきて、\nお説教する羽目になったし。", /*param_03*/10, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/0.5);
